void gen_descriptor_table_uvc_MJPEG(void)
{
    if(usb_sw_cfg_Get_UVC_Format_MJPEG_Enable_BANK37()) {
        g_recv_buf[BUFFER_INDEX_ID_NUMBER_LOW] = (DESCRIPTOR_TABLE_ID_INDEX_UVC_MJPEG_DT<<2) + 0x10;  // uvc_mjpeg_timing
        get_id_data_to_sram();
        uvc_vs_length = uvc_vs_length + table_size;
        if(table_size!=0) {
            uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_LOW] = total_length & 0xff;
            uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_HI]  = (total_length>>8) & 0xff;
            g_recv_buf[BUFFER_INDEX_ID_NUMBER_LOW] = (DESCRIPTOR_TABLE_ID_INDEX_UVC_COLOR_MATCH_DT<<2) + 0x10;  // uvc VS Color Matching Descriptor Descriptor
            get_id_data_to_sram();
            uvc_vs_length = uvc_vs_length + table_size;

            // set MJ color matching to SMPTE 170M (BT.601)
            dwc_u8_temp1 = (UINT8*)&dwc_get_taable_i;
            *(dwc_u8_temp1+0) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_LOW];
            *(dwc_u8_temp1+1) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_HI];
            udpdate_description_table_data_unit(0x04, 0x03, 1);

            dwc_u8_temp1 = (UINT8*)&dwc_get_taable_i;
            *(dwc_u8_temp1+0) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_LOW];
            *(dwc_u8_temp1+1) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_HI];
            udpdate_description_table_data_unit(0x04, 0x04, 1);

            dwc_u8_temp1 = (UINT8*)&dwc_get_taable_i;
            *(dwc_u8_temp1+0) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_LOW];
            *(dwc_u8_temp1+1) = uvc_temp_data[BUFFER_INDEX_ID_VS_UVC_MJ_COLOR_MATCHING_OFFSET_HI];
            udpdate_description_table_data_unit(0x04, 0x05, 1);
        }
    }
}

