void rtk_dwc3_get_string_from_flash_file(UINT16 wLength) __banked
{
    total_length = 0;
    uvc_vs_length = 0;

    //pm_printk(0, "rtk_dwc3_get_string %x\n", (UINT32)dwc_temp1);

    uvc_temp_data[0] = 1; // use flash data

    switch(dwc_temp1) {
        default:
            uvc_temp_data[0] = 0; // no use flash data
            break;
    }

    if(dwc_u8_DT_from_flash == 0)
        uvc_temp_data[0] = 0;

    if(uvc_temp_data[0] == 1) {
        p_dwc_temp1_u8_1 = (void*)(g_rtk_dwc3.ep0_setup_buf_addr + 0 + usb_phy_vir_offset);
        rtk_dwc3_get_config_file_name_by_speed();
        get_id_data_to_sram();
        g_rtk_dwc3.ep0_setup_buf_len = wLength < total_length ? wLength : total_length;
    } else {
        p_dwc_temp1_u8 = (UINT8*)descriptor_type_string[dwc_temp1];
        if(wLength < descriptor_type_string_length[dwc_temp1])
            g_rtk_dwc3.ep0_setup_buf_len = wLength;
        else
            g_rtk_dwc3.ep0_setup_buf_len = descriptor_type_string_length[dwc_temp1];
        dwc_info.dst = (void*)(g_rtk_dwc3.ep0_setup_buf_addr + 0 + usb_phy_vir_offset);
        dwc_info.src = p_dwc_temp1_u8;
        dwc_info.len = g_rtk_dwc3.ep0_setup_buf_len;
        dwc3_copy_to_memory2_utility();
    }
}

void rtk_dwc3_string_need_use_serial(UINT16 offset)
{
    switch(offset){
        case USB_USER_DATA_UVC_NAME_OFSET:
        case USB_USER_DATA_UAC_IN_NAME_OFSET:
        case USB_USER_DATA_UAC_OUT1_NAME_OFSET:
        case USB_USER_DATA_UAC_OUT2_NAME_OFSET:
            if(dwc_usb_string_need_use_serial == 1) {
                dwc3_get_usb_information_important_area(USB_IMPDATA_SERIAL_NUMBER_OFSET, g_recv_buf, USB_USER_DTAT_MAX_LENGTH_PER_ITEM);
                for(i = 0; i < g_recv_buf[1]; i++) {
                    dwc_buf[dwc_buf[0] + 2 * i] = g_recv_buf[i + 2];
                    dwc_buf[dwc_buf[0] + 1 + 2 * i] = 0x00;
                }
                dwc_buf[0] = dwc_buf[0] + i*2;
            }
            break;
        default:
            break;
    }
}

void rtk_dwc3_get_string_from_flash_sector(UINT16 offset, UINT16 wLength) __banked
{
    memset(g_recv_buf, 0, USB_USER_DTAT_MAX_LENGTH_PER_ITEM);
    dwc3_get_usb_information(offset, g_recv_buf, USB_USER_DTAT_MAX_LENGTH_PER_ITEM);

    if((g_recv_buf[0] != 0x5A) || g_recv_buf[1] > (USB_USER_DTAT_MAX_LENGTH_PER_ITEM-2)) {
        if(offset == USB_USER_DATA_UAC_OUT1_NAME_OFSET) {
            g_recv_buf[1] = 9;
            dwc3_memcpy_utility(&g_recv_buf[2], "PRODUCT-1", 9);
        }
        else if(offset == USB_USER_DATA_UAC_OUT2_NAME_OFSET) {
            g_recv_buf[1] = 9;
            dwc3_memcpy_utility(&g_recv_buf[2], "PRODUCT-2", 9);
        }
        else {
            g_recv_buf[1] = 7;
            dwc3_memcpy_utility(&g_recv_buf[2], "PRODUCT", 7);
        }
    }

    dwc_buf[0] = (g_recv_buf[1] << 1) + 2;
    dwc_buf[1] = 0x3;
    for(i = 0; i < g_recv_buf[1]; i++) {
        dwc_buf[2 + 2 * i] = g_recv_buf[i + 2];
        dwc_buf[3 + 2 * i] = 0x00;
    }

    rtk_dwc3_string_need_use_serial(offset);

    g_rtk_dwc3.ep0_setup_buf_len = (dwc_buf[0] > wLength) ? wLength : dwc_buf[0];
    dwc_info.dst = (void*)(g_rtk_dwc3.ep0_setup_buf_addr + usb_phy_vir_offset);
    dwc_info.src = dwc_buf;
    dwc_info.len = g_rtk_dwc3.ep0_setup_buf_len;
    dwc3_copy_to_memory2_utility();
}

void rtk_dwc3_get_string_from_flash_sector_important_area(UINT16 offset, UINT16 wLength) __banked
{
    memset(g_recv_buf, 0, USB_USER_DTAT_MAX_LENGTH_PER_ITEM);
    dwc3_get_usb_information_important_area(offset, g_recv_buf, USB_USER_DTAT_MAX_LENGTH_PER_ITEM);
	if((g_recv_buf[0] != 0x5A) || g_recv_buf[1] > (USB_USER_DTAT_MAX_LENGTH_PER_ITEM-2)) {
		g_recv_buf[1] = 7;
		dwc3_memcpy_utility(&g_recv_buf[2], "PRODUCT", 7);
	}
	dwc_buf[0] = (g_recv_buf[1] << 1) + 2;
	dwc_buf[1] = 0x3;
	for(i = 0; i < g_recv_buf[1]; i++) {
		dwc_buf[2 + 2 * i] = g_recv_buf[i + 2];
		dwc_buf[3 + 2 * i] = 0x00;
	}

	switch(offset){
		case USB_IMPDATA_SERIAL_NUMBER_OFSET:
			if(g_recv_buf[2] == '#'  && g_recv_buf[3] == '#') {
				dwc_usb_string_need_use_serial = 1;
			}
			break;
		default:
			break;
	}

	g_rtk_dwc3.ep0_setup_buf_len = (dwc_buf[0] > wLength) ? wLength : dwc_buf[0];
	dwc_info.dst = (void*)(g_rtk_dwc3.ep0_setup_buf_addr + 0 + usb_phy_vir_offset);
	dwc_info.src = dwc_buf;
	dwc_info.len = g_rtk_dwc3.ep0_setup_buf_len;
	dwc3_copy_to_memory2_utility();

}

void rtk_dwc3_get_string(UINT16 wLength) __banked
{
	switch(dwc_temp1) {
	case 3://Serial number
		rtk_dwc3_get_string_from_flash_sector_important_area(USB_IMPDATA_SERIAL_NUMBER_OFSET, wLength);
		break;
	case 5:
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UVC_NAME_OFSET, wLength);
		break;
	case 6:
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_MANUFACTURER_NAME_OFSET, wLength);
		break;
	case 4:
	case 7:
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_PRODUCT_NAME_OFSET, wLength);
		break;
	case 8: // UAC IN
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_IN_NAME_OFSET, wLength);
		break;
	case 9: // UAC OUT1
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_OUT1_NAME_OFSET, wLength);
		break;
	case 0xA: // UAC OUT2
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_OUT2_NAME_OFSET, wLength);
		break;
	case 0xB: // UAC IN Interface Name
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_IN_INTERFACE_NAME_OFSET, wLength);
		break;
	case 0xC: // UAC OUT1 Interface Name
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_OUT1_INTERFACE_NAME_OFSET, wLength);
		break;
	case 0xD: // UAC OUT2 Interface Name
		rtk_dwc3_get_string_from_flash_sector(USB_USER_DATA_UAC_OUT2_INTERFACE_NAME_OFSET, wLength);
		break;
	default:
		rtk_dwc3_get_string_from_flash_file(wLength);
		break;
	}
}



