UINT32 AT_USB_Get_HostProtocol(UINT8* p_usb_user_data)
{
    p_usb_user_data[0] = 0x00;
    p_usb_user_data[1] = 0x00;
    p_usb_user_data[2] = 0x00;
    p_usb_user_data[3] = 0x00;

    switch (g_rtk_dwc3.speed) {
        case USB_SPEED_HIGH:
            p_usb_user_data[0] = MSG_USB_CONNECT_SPEED_HS;
            break;
        case USB_SPEED_SUPER:
            p_usb_user_data[0] = MSG_USB_CONNECT_SPEED_SS;
            break;
        case USB_SPEED_SUPER_PLUS:
            p_usb_user_data[0] = MSG_USB_CONNECT_SPEED_SSP;
            break;
        default:
            p_usb_user_data[0] = MSG_USB_CONNECT_SPEED_UNKNOW;
            break;
    }
    return 1;
}

